import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import { Drawer, List, ListItem, ListItemIcon, ListItemText, IconButton } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import YouTubeIcon from '@mui/icons-material/YouTube';
import SubscriptionsIcon from '@mui/icons-material/Subscriptions';
import PersonIcon from '@mui/icons-material/Person';

import MoreHorizIcon from '@mui/icons-material/MoreHoriz';
import SearchIcon from '@mui/icons-material/Search';
import AddShoppingCartIcon from '@mui/icons-material/AddShoppingCart';
import './Navbar.css';
import './App.css';
import SalesPage from '../src'
import ImageSlider from './Slider';
import ContactPage from './ContactPage';
import CompleteView from './CompleteView';
import Login from './Login';
import DisplayPage from './DisplayPage';
import SignUpPage from './SignUpPage';
import ProductUpload from './ProductUpload';

const App = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [isSearchVisible, setIsSearchVisible] = useState(false);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);
  const handleSearchClick = () => setIsSearchVisible(true);
  const handleCloseSearch = () => setIsSearchVisible(false);

  return (
    <Router>
      <nav className="navbar">
        {/* Logo */}
        <div className="logo">WENALI!</div>

        {/* Desktop View */}
        <div className="nav-desktop">
          <ul className="nav-links">
            <li><Link to="/ContactPage">Contact</Link></li>
            <li><Link to="/">Home</Link></li>
            <li><Link to="/topwear">MensWear</Link></li>
            <li><Link to="/bottomwear">WomensWear</Link></li>
            <li><Link to="/SalesPage">Sales</Link></li>
          </ul>

          <ul className="nav-icons">
            <li onClick={handleSearchClick}>
              <SearchIcon />
            </li>
            <li>
              <Link to="/Login"><PersonIcon /></Link>
            </li>
            <li>
              <AddShoppingCartIcon />
            </li>
          </ul>
        </div>

        {/* Mobile View */}
        <div className="nav-mobile">
          <IconButton className="more-button" onClick={toggleSidebar}>
            <MoreHorizIcon />
          </IconButton>
          <Drawer
            anchor="left"
            open={sidebarOpen}
            onClose={toggleSidebar}
            variant="temporary"
            sx={{
              '& .MuiDrawer-paper': {
                width: 250,
                boxSizing: 'border-box',
              },
            }}
          >

















            <div className="sidebar">
              <List>
                <ListItem button component={Link} to="/" onClick={toggleSidebar}>
                  <ListItemIcon><HomeIcon /></ListItemIcon>
                  <ListItemText primary="Home" />
                </ListItem>

                <ListItem button component={Link} to="/Login" onClick={toggleSidebar}>
                  <ListItemIcon><YouTubeIcon /></ListItemIcon>
                  <ListItemText primary="Login" />
                </ListItem>

                <ListItem button component={Link} to="/ContactPage" onClick={toggleSidebar}>
                  <ListItemIcon><SubscriptionsIcon /></ListItemIcon>
                  <ListItemText primary="Contact" />
                </ListItem>

                <ListItem button component={Link} to="/ContactPage" onClick={toggleSidebar}>
                  <ListItemIcon><SubscriptionsIcon /></ListItemIcon>
                  <ListItemText primary="Contact" />
                </ListItem>

              </List>
            </div>
          </Drawer>
        </div>
      </nav>

      <div className="maincontent">
        <Routes>
          <Route path="/" element={<ImageSlider />} />
          <Route path="/ContactPage" element={<ContactPage />} />
          <Route path="/CompleteView" element={<CompleteView />} />
          <Route path="/Login" element={<Login />} />
          <Route path="/SalesPage" element={<SalesPage />} />
          <Route path="/MensWearPage" element={<MensWearPage />} />
          <Route path="/WomensWearPage" element={<WomensWearPage />} />
          <Route path="/DisplayPage" element={<DisplayPage />} />
          <Route path="/SignUpPage" element={<SignUpPage />} />
          <Route path="/ProductUpload" element={<ProductUpload />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
